import { Container, Grid, Typography } from '@mui/material';
import React from 'react';
import Image from '../atoms/Image';
import girl from '../atoms/images/girl.png'
interface Props{

}
const Banner=(props:Props)=> {
    return (
        <div>
            <Container>
                <Grid container>
                    <Grid item>
                        <Typography style={{height: '90px',width: '319px',
        left: '45px',top: '45px',fontSize: '36px',fontStyle: 'normal',fontWeight: '700',
        lineHeight: '45px',textAlign: 'left',}} variant='h4'>
                            Explore Books on entrepreneurship</Typography>

            <Typography style={{height: '69px',width: '461px',
        left: '45px',top: '150px',fontSize: '18px',fontStyle: 'normal',fontWeight: '400',
        lineHeight: '23px',textAlign: 'left',}} variant='subtitle2'>
            Everything you need to know about thriving on a shoestring budget, making your first million, and hiring right from the start.
            </Typography>
            <Image path={girl} style={{height:'264px' , width:'260px'}}/>
                    </Grid>
                </Grid>
            </Container>
        </div>
    );
}

export default Banner;
